    return (
        <View style={style.container}>
            <View style={style.topBar}>
                <Text>Sign up</Text>

            </View>
            <View style={style.centerArea}>
                <Text>Create Password</Text>

                <TextInput style={style.field} placeholder="Password"></TextInput>
                {/* Show Password */}

                <TouchableOpacity >
                    <Text>Next</Text>
                </TouchableOpacity>
